script: |
  super -f text -I q9332.spq | sort > q9332.out

inputs:
  - name: q9332.spq
    data: |
      SELECT DISTINCT - cor0.col2 + tab1.col1 FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9332.out
    data: |
      -1
      -12
      -13
      -14
      -16
      -17
      -25
      -28
      0
